<span class="line"><span style="color:#C792EA;">const</span><span style="color:#A6ACCD;"> arr [0</span><span style="color:#89DDFF;">,</span><span style="color:#A6ACCD;">1]</span><span style="color:#89DDFF;">;</span></span>
